if (window._mayoStop) {
  // was initialized already
  window._mayoStop();
} else {
  // never initialized, do
  window._mayoOptionsSize = 40;
  window._mayoOptionsViscosity = 150;
  window._mayoOptionsType = 'mayo';
  window._mayoEnabled = false;
}

const AUDIO_SRC =
  'data:audio/ogg;base64,';

const { sqrt, pow, atan2, PI, max, min, cos, sin } = Math;

const getSinToSmaller = (from, to, pos) =>
  to + (cos(PI * pos) + 1) * (from - to) * 0.5;

const getSinToBigger = (from, to, pos) =>
  from + (cos(PI * pos + PI) + 1) * (to - from) * 0.5;

const getSinFn = (from, to) => {
  if (from < to) {
    return getSinToBigger;
  }

  return getSinToSmaller;
};

const getDistance = (x1, y1, x2, y2) => sqrt(pow(x2 - x1, 2) + pow(y2 - y1, 2));
const getAngle = (x1, y1, x2, y2) => atan2(x2 - x1, y1 - y2);

const getX = (distance, angle, x1) => distance * sin(angle) + x1;
const getY = (distance, angle, y1) => -distance * cos(angle) + y1;

const maxWidth = () =>
  max(
    window.screen.width || 0,
    // document.body.scrollWidth || 0,
    // document.documentElement.scrollWidth || 0,
    document.documentElement.clientWidth || 0,
    //document.documentElement.offsetWidth || 0,
  );

const maxHeight = () =>
  max(
    window.screen.height || 0,
    // document.body.scrollHeight || 0,
    // document.documentElement.scrollHeight || 0,
    document.documentElement.clientHeight || 0,
    //document.documentElement.offsetHeight || 0,
  );

const createCanvas = (
  attrs = { width: maxWidth(), height: maxHeight() },
  styles = { position: 'fixed' },
  insert = false,
) => {
  const element = document.createElement('canvas');

  Object.assign(element, attrs);
  Object.assign(element.style, styles);

  if (insert) {
    document.body.prepend(element);
  }

  const context = element.getContext('2d');

  return { element, context };
};

const { element: cFill, context: cxFill } = createCanvas();
const { element: cStroke, context: cxStroke } = createCanvas();
const { element: cResult, context: cxResult } = createCanvas(undefined, {
  display: 'block',
  position: 'absolute',
  zIndex: Number.MAX_SAFE_INTEGER,
  top: 0,
  left: 0,
});

/*
  MAX_THICKNESS and MAX_DISTANCE are configurable options now
  and set in applyOptions()
*/
let MAX_THICKNESS;
let MAX_DISTANCE;
const MIN_DISTANCE = 5;

let drawing = false;
let drawRequestPending = false;

let records;

const addEventRecord = ({ offsetX, offsetY }) => {
  const { length } = records;

  if (length) {
    const { x: startX, y: startY } = records[length - 1];
    const distance = getDistance(startX, startY, offsetX, offsetY);

    records.push({
      x: offsetX,
      y: offsetY,
      distance,
      angle: getAngle(startX, startY, offsetX, offsetY),
      thickness:
        (MAX_THICKNESS * (1 - min(distance, MAX_DISTANCE) / MAX_DISTANCE)) >> 0,
    });
  } else {
    records.push({
      x: offsetX,
      y: offsetY,
    });
  }
};

const reduceRecords = () => {
  const { length } = records;
  records = records.slice(length - 1, length);
};

const resetRecords = () => {
  records = [];
};

const drawLineByXY = (thickness, startX, startY, endX, endY) => {
  cxFill.lineWidth = thickness;

  cxFill.beginPath();
  cxFill.moveTo(startX, startY);
  cxFill.lineTo(endX, endY);
  cxFill.stroke();
};

const drawLineWithSinThick = (
  startThickness,
  endThickness,
  sinFn,
  startX,
  startY,
  distance,
  angle,
) => {
  let currentX = startX;
  let currentY = startY;

  for (let current = 1; current <= distance; current++) {
    const currentThickness = sinFn(
      startThickness,
      endThickness,
      current / distance,
    );

    cxFill.beginPath();
    cxFill.moveTo(currentX, currentY);

    currentX = getX(current, angle, startX);
    currentY = getY(current, angle, startY);

    cxFill.lineTo(currentX, currentY);

    cxFill.lineWidth = currentThickness;
    cxFill.closePath();
    cxFill.stroke();
  }
};

const drawRecord = (startPosition, currentPosition, nextPosition) => {
  const { x: endX, y: endY, distance, angle, thickness } = currentPosition;

  if (thickness < 5) {
    return;
  }

  const { x: startX, y: startY, thickness: prevThickness } = startPosition;
  let nextThickness;

  if (nextPosition) {
    nextThickness = nextPosition.thickness;
  }

  const halfDistance = (distance * 0.5) >> 0;
  const halfX = getX(halfDistance, angle, startX);
  const halfY = getY(halfDistance, angle, startY);

  if (prevThickness === undefined || prevThickness === thickness) {
    drawLineByXY(thickness, startX, startY, halfX, halfY);
  } else {
    drawLineWithSinThick(
      prevThickness,
      thickness,
      getSinFn(prevThickness, thickness),
      startX,
      startY,
      halfDistance,
      angle,
    );
  }

  drawLineByXY(thickness, halfX, halfY, endX, endY);
};

const blendFinalImage = () => {
  cxStroke.globalCompositeOperation = 'source-over';
  cxResult.globalCompositeOperation = 'source-over';

  cxResult.clearRect(0, 0, cResult.width, cResult.height);

  cxStroke.clearRect(0, 0, cStroke.width, cStroke.height);
  cxStroke.fillRect(0, 0, cStroke.width, cStroke.height);
  cxStroke.globalCompositeOperation = 'destination-out';
  cxStroke.drawImage(cFill, 0, 0);
  cxStroke.filter = 'blur(5px)';

  cxResult.drawImage(cFill, 0, 0);
  cxResult.globalCompositeOperation = 'source-atop';
  cxResult.drawImage(cStroke, 0, 0);
};

const drawRecords = () => {
  drawRequestPending = false;
  const { length } = records;

  for (let index = 1; index < length; index++) {
    drawRecord(records[index - 1], records[index], records[index + 1]);
  }

  reduceRecords();
  blendFinalImage();
};

const waitToRedrawRecords = () => requestAnimationFrame(drawRecords);

const mouseMoveHandler = (event) => {
  if (!drawing) {
    return;
  }

  addEventRecord(event);

  if (!drawRequestPending) {
    drawRequestPending = true;
    waitToRedrawRecords();
  }
};

cxFill.lineJoin = 'round';
cxFill.lineCap = 'round';

const set = (obj, name, value, restore = null) => {
  let restoreMore;

  if (name === undefined) {
    restoreMore = restore;
  } else {
    const prev = obj[name];
    obj[name] = value;

    restoreMore = () => {
      restore && restore();

      obj[name] = prev;
    };
  }

  const setMore = (name, value) => set(obj, name, value, restoreMore);
  setMore.restore = restoreMore;

  return setMore;
};

const clearCanvases = () => {
  cxResult.clearRect(0, 0, cResult.width, cResult.height);
  cxStroke.clearRect(0, 0, cStroke.width, cStroke.height);
  cxFill.clearRect(0, 0, cFill.width, cFill.height);
};

const applyOptions = () => {
  MAX_THICKNESS = window._mayoOptionsSize;
  MAX_DISTANCE = window._mayoOptionsViscosity;

  switch (window._mayoOptionsType) {
    case 'bbq':
      cxFill.strokeStyle = '#421709'; // '#8E4103';
      //cxStroke.fillStyle = '#421709';
      break;
    case 'mustard':
      cxFill.strokeStyle = '#E6CB4E';
      //cxStroke.fillStyle = '#B48107';
      break;
    case 'ketchup':
      cxFill.strokeStyle = '#E42D26';
      //cxStroke.fillStyle = '#971017';
      break;
    case 'hmmayo':
      cxFill.strokeStyle = '#F7F1D1';
      //cxStroke.fillStyle = '#EDBE4F';
      break;
    case 'wasabi':
      cxFill.strokeStyle = '#A0C003';
      //cxStroke.fillStyle = '#647700';
      break;
    case 'guacamole':
      cxFill.strokeStyle = '#B8D569';
      //cxStroke.fillStyle = '#69862B';
      break;
    case 'mayo':
    default:
      cxFill.strokeStyle = '#F5F2ED';
      //cxStroke.fillStyle = '#DDC9A7';
      break;
  }

  cxStroke.fillStyle = '#bbbbaa';
};

let locked;
let lastYScrollPosition = 0;

const clearIfScrolled = () => {
  const { top } = document.documentElement.getBoundingClientRect();

  if (Math.abs(top - lastYScrollPosition) > 50) {
    clearCanvases();
  }

  lastYScrollPosition = top;
};

const lockBody = () => {
  const { body, documentElement } = document;
  locked = set(body.style)
    // ('overflow', 'hidden')
	('user-select', 'none');

  requestAnimationFrame(() => {
    const { top, left } = documentElement.getBoundingClientRect();

    set(cResult.style)('top', `${-top}px`)('left', `${-left}px`);
  });

  cResult.focus();
};

const unlockBody = () => {
  locked.restore();
};

let mayoAudio;

const createAudio = () => {
  if (mayoAudio) {
    mayoAudio.pause();
  }

  mayoAudio = new Audio(AUDIO_SRC);
  mayoAudio.loop = true;
};

const mouseUpHandler = (event) => {
  drawing = false;

  unlockBody();
  mayoAudio.pause();
  window.removeEventListener('mouseup', mouseUpHandler);
};

const mouseDownHandler = (event) => {
  const { offsetX, offsetY } = event;

  applyOptions();
  clearIfScrolled();
  lockBody();
  resetRecords();
  addEventRecord(event);
  mayoAudio.play();
  drawing = true;

  window.addEventListener('mouseup', mouseUpHandler);
};

window._mayoStop = () => {
  window.removeEventListener('mousedown', mouseDownHandler);
  window.removeEventListener('mouseup', mouseUpHandler);
  cResult.removeEventListener('mousemove', mouseMoveHandler);
  if (document.body.contains(cResult)) {
    clearCanvases();
    document.body.removeChild(cResult);
  }
  window._mayoEnabled = false;
};

window._mayoStart = () => {
  window._mayoStop();
  createAudio();
  document.body.prepend(cResult);
  window.addEventListener('mousedown', mouseDownHandler);
  cResult.addEventListener('mousemove', mouseMoveHandler);
  window._mayoEnabled = true;
};
